Minority Report (2002)
PG-13 | 145 min | Action, Mystery, Sci-Fi | 21 June 2002 (USA)

Based on a story by famed science fiction writer Philip K. Dick, &quot;Minority Report&quot; is an action-detective thriller set in Washington D.C. in 2054, where police utilize a psychic technology to arrest and convict murderers before they commit their crime. Tom Cruise plays the head of this Precrime unit and is himself accused of the future murder of a man he hasn't even met.

Stars: Tom Cruise, Colin Farrell, Samantha Morton


